%script 

DECLARE
v_sql varchar2(100);

--Create a Build Setting for GLR 
BEGIN
    v_sql := 'CREATE TABLE SETTINGS_TABLE_NAME_GLR (SETTING_NAME  VARCHAR2(30),SETTING_VALUE VARCHAR2(4000))';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
